    {
        req: 1, //시퀀스
        title: "누상동 다목적 운동장", //명칭
        tag: ["인도어풋살장", "무료"],
        lat: "37.5795876",
        lng: "126.9636324",
    },
    {
        req: 2, //시퀀스
        title: "서대문 돌산구장", //명칭
        tag: ["인조잔디축구장", "무료"],
        lat: "37.602835",
        lng: "126.945915",
    },
    {
        req: 3, //시퀀스
        title: "서울 농학교 풋살장", //명칭
        tag: ["인도어풋살장", "무료"],
        lat: "37.584397",
        lng: "126.968567",
    },
]
export const initialState = {
    latitude: "37.5795876",
    longitude: "126.9636324",
    stadiumList: {},
}

export const CHANGE_LOCATION = 'CHANGE_LOCATION';
export const GET_STADIUM_LIST = 'GET_STADIUM_LIST';

export const changeLocationAction = (data) => {
    return {
        type: CHANGE_LOCATION,
        data,
    };
}

export const getStadumList = (data) => {
    return {
        type: GET_STADIUM_LIST,
        data,
    }
}
export default (state = initialState, action) => {
    switch (action.type) {
        case CHANGE_LOCATION: {
            return {
                latitude: action.data.latitude,
                longitude: action.data.longitude,
            }
        }
        default: {
            return {
                ...state,
            }
        }
    }
}
